INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (1, 10001, "クローチェ", "いらっしゃいませっ♪\nキャラバンコインを使って\n買い物ができますよっ！", 0.0, "2023/09/22 14:59:59", 1, -470.0, 2002, 2, 126401, 1.47, "2023/06/30 12:00:00", 1);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (2, 10002, "クローチェ", "素敵な品が揃ってるので\nたーっくさん買っていって\nくださいねっ♪", 0.0, "2023/09/22 14:59:59", 2, -470.0, 2002, 1, 126401, 2.15, "2023/06/30 12:00:00", 1);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (1, 10003, "ライラエル", "ショップへようこそ\nキャラバンコインはこちら\nで買い物に使えますよ", 0.0, "2023/09/22 14:59:59", 2, -470.0, 2002, 2, 126501, 0.0, "2023/06/30 12:00:00", 1);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (2, 10004, "ライラエル", "こちらのショップで\n買い物をして、素敵な\n旅を楽しんでくださいね", 0.0, "2023/09/22 14:59:59", 1, -470.0, 2002, 1, 126501, 0.0, "2023/06/30 12:00:00", 1);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (1, 10005, "リンド", "いらっしゃいませ\nキャラバンコインを使って\nお買い物ができますよ", 0.0, "2023/12/22 14:59:59", 2, -470.0, 2002, 2, 127702, 0.0, "2023/09/15 15:00:00", 2);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (2, 10006, "リンド", "ショップの掃除は完璧です\n姫さま直営のお店として\n当然のことですから", 0.0, "2023/12/22 14:59:59", 2, -470.0, 2002, 2, 127702, 0.0, "2023/09/15 15:00:00", 2);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (1, 10007, "ヴルム", "ショップへようこそ\nキャラバンコインと品物を\n交換できるんで、よければ", 0.0, "2023/12/22 14:59:59", 1, -470.0, 2002, 1, 127802, 0.0, "2023/09/15 15:00:00", 2);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (2, 10008, "ヴルム", "なんで店番なんか…\nま、やりますけど\n好きな品物をどうぞ", 0.0, "2023/12/22 14:59:59", 2, -470.0, 2002, 1, 127802, 6.5, "2023/09/15 15:00:00", 2);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (1, 10009, "アネモネ", "──いらっしゃいませ\n買い物しても、いいですよ\nキャラバンコインがあれば", 0.0, "2024/03/22 14:59:59", 2, -470.0, 2002, 1, 129602, 0.0, "2023/12/15 15:00:00", 3);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (2, 10010, "アネモネ", "──もっと笑顔がほしい？\nいくらコインを積まれても\n売れない物はありますから", 0.0, "2024/03/22 14:59:59", 2, -470.0, 2002, 1, 129602, 0.0, "2023/12/15 15:00:00", 3);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (1, 10011, "ネフィ=ネラ", "ようこそおいでなんし\nキャラバンコインをこちら\nで交換して進ぜんしょう", 0.0, "2024/03/22 14:59:59", 1, -470.0, 2002, 1, 129701, 0.0, "2023/12/15 15:00:00", 3);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (2, 10012, "ネフィ=ネラ", "ところで、お前さまは\nいくらで贖えるのか喃？\n──フフ、冗談でありんす", 0.0, "2024/03/22 14:59:59", 2, -470.0, 2002, 1, 129701, 6.2, "2023/12/15 15:00:00", 3);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (1, 10013, "カノン", "い、いらっしゃいませっ！\n…くっ…このあたくし様が\n店番なんて…屈辱ですわっ", 0.0, "2024/06/22 14:59:59", 3, -470.0, 2002, 5, 130301, 3.1, "2024/03/15 15:00:00", 4);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (2, 10014, "カノン", "あら、あたくしをご所望？\nお生憎様、そんな小銭では\n…買えちゃうんですの！？", 0.0, "2024/06/22 14:59:59", 3, -470.0, 2002, 2, 130301, 6.15, "2024/03/15 15:00:00", 4);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (1, 10015, "ナーナ", "いらっしゃいませ～♪\nきゃらばんこいん？を\n交換できるんだってー", 0.0, "2024/06/22 14:59:59", 2, -470.0, 2002, 2, 130401, 0.0, "2024/03/15 15:00:00", 4);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (2, 10016, "ナーナ", "甘いのくれたら、\nお礼にナーナの拾った\n松ぼっくりあげちゃうよ！", 0.0, "2024/06/22 14:59:59", 2, -470.0, 2002, 1, 130401, 3.35, "2024/03/15 15:00:00", 4);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (1, 10017, "ホウオウ", "ショップへようこそ\nこの鳳凰が、皆さんに\n祝福を差し上げましょう", 0.0, "2024/09/22 14:59:59", 1, -470.0, 2002, 1, 130502, 0.0, "2024/06/15 15:00:00", 5);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (2, 10018, "ホウオウ", "ほーちゃんと呼ぶ権利は\n売っていませんよ？\n騎士さんへの、特別です！", 0.0, "2024/09/22 14:59:59", 2, -470.0, 2002, 1, 130502, 3.18, "2024/06/15 15:00:00", 5);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (3, 10019, "ホウオウ", "うﾞぇぇえんっ！まﾞだごの\n格好になっぢゃいまじだ！\n寄付をお願いじまず～っ！", 0.0, "2024/09/22 14:59:59", 4, -470.0, 2002, 4, 130503, 0.0, "2024/06/15 15:00:00", 5);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (1, 10020, "ネア", "おっすー♪\nなんでも交換してけー\nカリザきゅん以外で", 0.0, "2024/09/22 14:59:59", 1, -470.0, 2002, 2, 123301, 4.9, "2024/06/15 15:00:00", 5);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (2, 10021, "ネア", "ところで、騎士きゅんは\nおいくら万ルピ？\nジョーダンぬ・き・で♡", 0.0, "2024/09/22 14:59:59", 1, -470.0, 2002, 2, 123301, 4.8, "2024/06/15 15:00:00", 5);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (1, 10022, "カリザ", "ケッ、なんでオレ様が店番\nなんざ…って来んなキイロ\nオレは売りモンじゃねー！", 0.0, "2024/12/22 14:59:59", 3, -470.0, 2002, 1, 133301, 4.922, "2024/09/15 15:00:00", 6);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (2, 10023, "カリザ", "い、言わなきゃダメか？\n「…いらっしゃいませ…」\nクソッ、笑うんじゃねー！", 0.0, "2024/12/22 14:59:59", 3, -470.0, 2002, 5, 133301, 9.638, "2024/09/15 15:00:00", 6);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (1, 10024, "ミーア", "ショップへようこそ～\nネラさまの腹心…的な私が\n店番させていただきま～す", 0.0, "2024/12/22 14:59:59", 1, -470.0, 2002, 2, 133401, 2.88, "2024/09/15 15:00:00", 6);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (2, 10025, "ミーア", "私の抜け殻とか、\n需要ありますかね～…\nって冗談ですよ、冗談！", 0.0, "2024/12/22 14:59:59", 5, -470.0, 2002, 1, 133401, 4.818, "2024/09/15 15:00:00", 6);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (1, 10026, "グレイス", "へい、らっしゃい\nさ、騎士氏。冥土の土産は\nなにがいいですか？", 0.0, "2025/03/22 14:59:59", 2, -470.0, 2002, 1, 133002, 1.78, "2024/12/15 15:00:00", 7);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (2, 10027, "グレイス", "商品をお買い上げ毎に\nグレイスちゃんポイントを\n差し上げます。嘘ですが", 0.0, "2025/03/22 14:59:59", 1, -470.0, 2002, 7, 133002, 6.15, "2024/12/15 15:00:00", 7);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (1, 10028, "ヴァイオレット", "ようこそいらっしゃいませ\n…接客とは、このような\n振舞で宜しいでしょうか？", 0.0, "2025/03/22 14:59:59", 6, -470.0, 2002, 2, 133102, 4.28, "2024/12/15 15:00:00", 7);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (2, 10029, "ヴァイオレット", "じめじめした商品は\nございませんので\n安心してお買い求め下さい", 0.0, "2025/03/22 14:59:59", 1, -470.0, 2002, 1, 133102, 0.0, "2024/12/15 15:00:00", 7);
